import { Card } from "@material-ui/core";
import axios from "axios";
import React, { useState } from "react";
import {  useParams } from "react-router-dom";

const CardPage = () => {
    const {id} = useParams();
    const [CardInfo, setCardInfo] = useState();
    
    useEffect(() =>{
        axios.get("localhost://8081/card/" + id).then((res)=>{
            const data = res.data;
            setCardInfo(data);
        });
    },[]);

    const {id: name, cardClass, cost, rarity,url,text} = CardInfo || {};

    return (
        <div>
            <h4 >  {name} </h4>
            <h4> class: {cardClass} </h4>
            <h4> cost: {cost} </h4>
            <h4> rarity: {rarity} </h4>
            <img src = {url}/>
            <h4> text: {text} </h4>

        </div>
      );



}

export default CardPage;
